script: |
  super -f text -I q11797.spq | sort > q11797.out

inputs:
  - name: q11797.spq
    data: |
      SELECT ALL col0 - - col0 / - 59 * - col1 AS col0 FROM tab2 (FORMAT parquet) WHERE NULL BETWEEN - + CAST ( NULL AS REAL ) * + - col1 * col2 * 24 - - 98 - + col0 AND + 35;
  - name: tab2

outputs:
  - name: q11797.out
    data: |
